import React from "react";

import Email from "./Email.jsx";

function EmailList(props) {
    return (
        <div>
            {props.emails.map((email, index) => (
                <Email 
                    email={email} 
                    key={index}
                    removeEmail={props.removeEmail}
                />
            ))}
        </div>
    )
}

export default EmailList;
